import { useState, useEffect } from 'react';


export default function MisPeliculas() {

    const [nombre, setNombre] = useState('');
    const [lista, setLista] = useState({
        miLista: []
    })


    function getData(){
        return localStorage.getItem('nombre');
    }
    
    useEffect (() =>{                              
        
        setNombre(getData());
                               
        
    }, []);

    console.log('LISTA: ', lista);
  return (
    <div>
        <h3>{nombre}</h3>
        <h3>{lista}</h3>
    </div>
  )
}
